":{"unit":"px","size":70},"typography_font_size_mobile":{"unit":"px","size":30},"typography_font_weight":"100","text_shadow_text_shadow":{"horizontal":10,"vertical":10,"blur":50,"color":"rgba(0,0,0,0.3)"},"_margin":{"unit":"px","top":"22","right":"-16","bottom":"21","left":"-350","isLinked":false},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true},"_padding":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":false},"_margin_tablet":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"heading"},{"id":"77a0b31","elType":"widget","settings":{"editor":"<p style=\"font-weight: 400;\">A AMBr se prepara para completar 60 anos de funda\u00e7\u00e3o.<\/p>\n<p style=\"font-weight: 400;\">De uma pequena sala no Edif\u00edcio Pioneiras Sociais ao complexo administrativo-social constru\u00eddo no Setor de Clubes Sul, a AMBr passou por diversos momentos e foi capitaneada por m\u00e9dicos ilustres como o ex-Presidente Juscelino Kubstichek. Sempre com o vi\u00e9s do ensino continuado e congrega\u00e7\u00e3o dos m\u00e9dicos e suas fam\u00edlias.&nbsp;<\/p><p style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-style: normal;\">A AMBr \u00e9 feita de ideias. S\u00f3 est\u00e1 aqui, hoje, porque, h\u00e1 60 anos, profissionais realmente comprometidos com o futuro da medicina do Distrito Federal tiveram uma grande ideia: formar uma entidade representativa para congregar os m\u00e9dicos da nova capital, que vinham de diversos pontos do pa\u00eds para discutir casos cl\u00ednicos e avan\u00e7os nas quest\u00f5es cient\u00edficas inerentes ao trabalho a medicina; fazer dessa congrega\u00e7\u00e3o fonte de lazer e divers\u00e3o: e defender o interesses da classe m\u00e9dica que tinham em Bras\u00edlia situa\u00e7\u00f5es peculiares e diferentes do restante do pa\u00eds.<\/span><\/p><p style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-style: normal;\">Ap\u00f3s a cria\u00e7\u00e3o da AMBr, em fevereiro em 1959, um ano antes da inaugura\u00e7\u00e3o da nova capital, m\u00e9dicos continuavam a chegar na cidade para preencher os postos de trabalho. Boa parte deles, assim que chegavam \u00e0 Bras\u00edlia, procuravam a AMBr para tornarem-se associados. Era um modo de conhecer os colegas e de ter uma boa inser\u00e7\u00e3o, pois desde sua funda\u00e7\u00e3o, a Associa\u00e7\u00e3o M\u00e9dica de Bras\u00edlia sempre foi refer\u00eancia de credibilidade.<\/span><\/p>\n<p style=\"font-weight: 400;\">Por isso, ao comemorar os nossos 60 anos de hist\u00f3ria, olhamos para tr\u00e1s e para frente ao mesmo tempo. Pois desde o primeiro dia fomos vanguardistas, fomos capazes de guiar os m\u00e9dicos para um amanh\u00e3 seguro e vitorioso. E continuaremos assim, crescendo juntos para anunciar um futuro de mais valor e reconhecimento para a nossa profiss\u00e3o.<\/p>","text_color":"#7a7a7a","typography_typography":"custom","typography_font_size":{"unit":"px","size":16},"typography_line_height":{"unit":"em","size":1.6},"_margin":{"unit":"%","top":"5","right":"0","bottom":"10","left":"12","isLinked":false},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false},{"id":"f8a8f68","elType":"section","settings":{"margin":{"unit":"px","top":"31","right":0,"bottom":"0","left":0,"isLinked":false},"_element_id":"celebracoes"},"elements":[{"id":"614795c","elType":"column","settings":{"_column_size":100},"elements":[{"id":"870e482","elType":"widget","settings":{"title":"Celebra\u00e7\u00f5es","align":"left","title_color":"#7dc49e","typography_typography":"custom","typography_font_family":"Barlow Condensed","typography_font_size":{"unit":"px","size":70},"typography_font_size_mobile":{"unit":"px","size":55},"typography_font_weight":"100","text_shadow_text_shadow":{"horizontal":10,"vertical":10,"blur":50,"color":"rgba(0,0,0,0.3)"